import React from "react";

function SidebarRow(props) {
  const { Icon, text } = props;
  return (
    <div>
      <div className="sidebar-list">
        <span className="icon">{Icon}</span>
        <span className="text">{text}</span>
      </div>
    </div>
  );
}

export default SidebarRow;
